        changeParams({
            collection: "areas",
            filter: {}
        })
        changeView()
        resolve("Vista Cambiada");
    })
    paramsProm.then(res => {
        console.log("res:", res)
        return (
            <div className="AreasVista">
                <TarjetasVista tarjetas={posts} />
            </div>
        );
    })
